// priceGridColumns.js

export const getColumns = (currencyIconMap) => [
    {
        field: "haveCurrency",
        headerName: "Have Currency",
        width: 200,
        renderCell: (params) => {
            const currencyName = params.value;
            const iconUrl = currencyIconMap[currencyName];
            return (
                <div style={{ display: "flex", alignItems: "center" }}>
                    {iconUrl && (
                        <img
                            src={iconUrl}
                            alt={currencyName}
                            style={{ width: 24, height: 24, marginRight: 8 }}
                        />
                    )}
                    {currencyName}
                </div>
            );
        }
    },
    {
        field: "wantCurrency",
        headerName: "Want Currency",
        width: 200,
        renderCell: (params) => {
            const currencyName = params.value;
            const iconUrl = currencyIconMap[currencyName];
            return (
                <div style={{ display: "flex", alignItems: "center" }}>
                    {iconUrl && (
                        <img
                            src={iconUrl}
                            alt={currencyName}
                            style={{ width: 24, height: 24, marginRight: 8 }}
                        />
                    )}
                    {currencyName}
                </div>
            );
        }
    },
    {
        field: "lastUpdated",
        headerName: "Last Updated",
        width: 180
    },
    {
        field: "rowType",
        headerName: "Type",
        width: 100
    },
    {
        field: "haveAmount",
        headerName: "Have Amt",
        type: "number",
        width: 100
    },
    {
        field: "wantAmount",
        headerName: "Want Amt",
        type: "number",
        width: 100
    },
    {
        field: "ninjaPrice",
        headerName: "Ninja Price",
        type: "number",
        width: 100
    },
    {
        field: "stock",
        headerName: "Stock",
        type: "number",
        width: 100
    }
];
